import React from 'react';

const Card = ({ title, content }) => {
    return ( <
        div className = "bg-white rounded-xl shadow-lg hover:shadow-2xl transition-shadow duration-300 overflow-hidden" >
        <
        div className = "p-6" >
        <
        h3 className = "text-xl font-semibold text-gray-900 mb-2" > { title } < /h3> <
        p className = "text-gray-600 mb-4" > { content } < /p> <
        button className = "bg-indigo-600 text-white font-semibold py-2 px-4 rounded-lg shadow-md hover:bg-indigo-700 transition-colors duration-300 w-full" >
        Request Item <
        /button> < /
        div > <
        /div>
    );
};

export default Card;
